-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `device_pass` varchar(60) DEFAULT NULL,
  `facebook_id` varchar(64) DEFAULT NULL,
  `uuid` varchar(64) DEFAULT NULL,
  `coins` bigint(20) DEFAULT NULL,
  `exp` bigint(20) DEFAULT NULL,
  `level` int(11) DEFAULT NULL,
  `vip_level` smallint(6) DEFAULT NULL,
  `vip_points` int(11) DEFAULT NULL,
  `first_login` datetime DEFAULT NULL,
  `last_login` datetime DEFAULT NULL,
  `last_logout` datetime DEFAULT NULL,
  `purchase_count` int(11) DEFAULT NULL,
  `total_purchase` int(11) DEFAULT NULL,
  `max_purchase` int(11) DEFAULT NULL,
  `max_weekly_purchase` int(11) DEFAULT NULL,
  `first_purchase` datetime DEFAULT NULL,
  `last_purchase` datetime DEFAULT NULL,
  `spin_count` int(11) DEFAULT NULL,
  `store_disconnection_data` varchar(1024) DEFAULT NULL,
  `user_flag` int(11) DEFAULT '0',
  `apple_sub_id` varchar(64) DEFAULT '',
  `hms_id` varchar(180) DEFAULT '',
  `login_in_cn` int(11) DEFAULT '0',
  `extra_int_1` int(11) DEFAULT '0',
  `extra_int_2` int(11) DEFAULT '0',
  `extra_int_3` int(11) DEFAULT '0',
  `pactsafe` int(11) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `index_hms_id` (`hms_id`) USING BTREE,
  KEY `index_facebook_id` (`facebook_id`) USING BTREE,
  KEY `index_apple_sub_id` (`apple_sub_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4718 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

